def infer_dtype_from_scalar(val, pandas_dtype: bool = False):
    """
    Interpret the dtype from a scalar.

    Parameters
    ----------
    pandas_dtype : bool, default False
        whether to infer dtype including pandas extension types.
        If False, scalar belongs to pandas extension types is inferred as
        object
    """

    dtype = np.object_

    # a 1-element ndarray
    if isinstance(val, np.ndarray):
        msg = "invalid ndarray passed to infer_dtype_from_scalar"
        if val.ndim != 0:
            raise ValueError(msg)

        dtype = val.dtype
        val = val.item()

    elif isinstance(val, str):
        dtype = np.object_

    elif isinstance(val, (pd.Timestamp, pd.DatetimeIndex)):
        val = pd.Timestamp(val)
        dtype = np.dtype("M8[ns]")

    elif isinstance(val, (pd.Timedelta, pd.TimedeltaIndex)):
        val = pd.Timedelta(val).value
        dtype = np.dtype("m8[ns]")

    elif is_bool(val):
        dtype = np.bool_

    elif is_integer(val):
        if isinstance(val, (int, np.integer)):
            dtype = type(val)
        else:
            dtype = np.int64

    elif is_float(val):
        if isinstance(val, (float, np.floating)):
            dtype = type(val)
        else:
            dtype = np.float64

    elif is_complex(val):
        dtype = np.complex_

    elif pandas_dtype:
        if isinstance(val, (pd.Period, pd.PeriodIndex)):
            dtype = pd.PeriodDtype(freq=val.freq)
            val = val.ordinal

    return dtype, val
